import React from  "react";


function MovieCard (props){
const movie = props.movie

    return (
        <div>
            <h2>{movie.title} look at movieList and movieCARD useEffect</h2>
            <p>{movie.description}</p>
            <div>
                <p>{movie.director}</p>
                <p>{movie.release_date}</p>
            </div>
        </div>
    )

}

export default  MovieCard
